import React from 'react';
import Contacts from "../meeting/Meeting";
import MeetingForm from "../meeting/MeetingForm";

const Home = () => {

   return(
       <div className="Grid-2">
        <div>
        <MeetingForm />
      </div>
      <div>
        <ContactFilter />
        <Contacts />
      </div>
       </div>
   )
}
export default Home;
